import React, { Component } from 'react';
import DashButton from './DashButton';
import { Button } from '@material-ui/core';

export default class CompleteRegistration extends Component {
    constructor(props) {
        super();
    }
    render() {
        return(
            <div>
            <h3 style={{color: "black", textAlign: "left", marginLeft: "16px", paddingTop: "8px"}}>Additional Registration</h3>
            <div style={{display: "flex", alignItems: "center", justifyContent: "center", flexDirection: "column"}}>
            <div style={{width: "85%", marginTop: "8px", justifyContent: "center", display: "flex", boxShadow: "0 0 10px -2px rgba(0, 0, 0, 0.095)"}}>
            <Button id="addContainer">
                <div id="addIcon">
                    <svg id="Component_2_1" data-name="Component 2 – 1" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" width="75" height="75" viewBox="0 0 75 75">
                        <image id="Image_1" data-name="Image 1" width="75" height="75" xlinkHref="data:image/png;base64,"/>
                    </svg>

                </div>
                <div>
                    <span id="addLabel">Add your business</span>
                </div>
            </Button>
            </div>
            <div style={{width: "85%", marginTop: "16px", justifyContent: "center", display: "flex", boxShadow: "0 0 10px -2px rgba(0, 0, 0, 0.095)"}}>
            <Button id="addContainer">
                <div id="addIcon">
                    <svg id="Component_2_1" data-name="Component 2 – 1" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" width="75" height="75" viewBox="0 0 75 75">
                        <image id="Image_1" data-name="Image 1" width="75" height="75" xlinkHref="data:image/png;base64,"/>
                    </svg>

                </div>
                <div>
                    <span id="addLabel">Sign up to deliver</span>
                </div>
            </Button>
            </div>
            </div>
            {/* <div style={{width: "100%", marginTop: "8px", justifyContent: "center", display: "flex"}}>
              <DashButton label="Sign up to deliver" />
            </div> */}

          </div>
        );
    }


}
